import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Home.css'; // ודאי שהנתיב נכון
import backgroundImage from './background.jpg';


const Home = () => {
  return (
    <div className="home-container">
      {/* לוגו */}
      <header className="home-header">
        <img src="/logo.png" alt="Deepfake Audio Detector Logo" className="logo" />
        <h1>Welcome to Deepfake Audio Detector</h1>
        <p>Discover the power of identifying deepfake audio through interactive tools.</p>
      </header>
      
      {/* כפתורים */}
      <div className="home-buttons">
        <Link to="/login" className="btn">Login</Link>
        <Link to="/signup" className="btn">Sign Up</Link>
      </div>
    </div>
  );
};

export default Home;
